import { useSpring, useTrail, animated } from "react-spring";
import styled from "styled-components";
import { Button } from "../components";
import Theme from "../theme";
import { FaFacebook } from "react-icons/fa";

const Nav_Button = animated((props) => Button({ type: "Nav", ...props }));
const Nav_Button_Tiny = animated((props) => Button({ type: "Tiny", ...props }));

const Container = animated(styled.div`
  position: fixed;
  width: 100%;
  z-index: 99;
  background-color: ${Theme.colors.c2};
  backdrop-filter: blur(6px);
  padding: 5px;

  .Nav_SubContainer {
    position: relative;
  }

  .Nav_SubContainer_Alt_Buttons {
    & > * {
      margin-left: 0.5em;
      margin-right: 0.5em;
    }

    position: absolute;
    display: flex;
    align-items: center;
    top: 10px;
    right: 10px;
  }
`);

function Nav({ store, dispatch }) {
  const { show, login } = store;
  const { y } = useSpring({
    y: show ? "translateY(0%)" : "translateY(-100%)",
  });

  const o = useTrail(6, { opacity: show ? 1 : 0 });

  return (
    <Container style={{ transform: y }}>
      <div className="Nav_SubContainer">
        <Nav_Button style={o[0]}>Sports</Nav_Button>
        <Nav_Button style={o[1]}> Roster</Nav_Button>
        <Nav_Button style={o[2]}>Contact</Nav_Button>
        <div className="Nav_SubContainer_Alt_Buttons">
          <Nav_Button_Tiny style={o[3]} type="Tiny">
            Register
          </Nav_Button_Tiny>
          <Nav_Button_Tiny
            onClick={!login && dispatch({ type: "SHOW_LOGIN" })}
            style={o[4]}
            type="Tiny"
          >
            Login
          </Nav_Button_Tiny>
          <FaFacebook>content</FaFacebook>
        </div>
      </div>
    </Container>
  );
}

export default Nav;
